<!doctype html>

<html lang="en">

<head>
  <meta charset="utf-8">
  <title>Embedded Analytics with Tableau</title>
  <script>
    function resizeIframe(obj) {
      obj.style.height = obj.contentWindow.document.documentElement.scrollHeight + 'px';
    }
  </script>
</head>

<body>
<iframe src="https://public.tableau.com/views/Bancor-Analytics-Export/FeeSelector?:showVizHome=no&:embed=true&:toolbar=no" 
 height="640" frameborder="0" scrolling="no" onload="resizeIframe(this)"></iframe>
</body>
